window.bookSummaryJSON = "<p>Aileen Travers thought she had it all figured out. Part private investigator, part fixer to the supernatural community, she was slowly building a reputation as the go-to vampire in Columbus. If you had a supernatural problem and nowhere to turn, she was the girl for you. The best part - no one had tried to kill her in weeks.</p> <p>Aileen's peaceful existence comes crashing down around her when an unwilling visit to the police station results in her picking up a stalker - or two. Now, Aileen is dodging suspicious looking portals while evading kidnapping attempts.</p> <p>Looks like Aileen has a new client. Herself.</p>"; 
